import React from "react";
import { motion } from "framer-motion";

class Android extends React.Component {
    render() {
        return (
            <>
                <h1 className="middle">Android</h1>
                <main className="grid" style={{paddingLeft: "2%", paddingRight: "2%"}}>
                    <div className="grid-around-space">
                        <span className="middle">NimmGameApp</span>
                        <img style={{paddingLeft:"36%", paddingRight:"35%"}} onClick={() => window.location += "/nimgameapp"} alt="" src="https://raw.githubusercontent.com/SillyGoose123/NimmGameApp/main/app/src/main/res/mipmap-xhdpi/ic_launcher.png"/>
                    </div>
                </main>      
            </>
        )
    }
}

function createCo(params) {
    
}

export default Android;
